    false,nt"url": null,nt"notes": "This annual narrative report for Litchfield
    Wetland Management District summarizes refuge activities during the 1992 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.  Land acquisition - including fee titles and easements topics are also
    covered.  The report includes a planning section which discusses refuge management
    plans and research.  Refuge administration is outlined; information about personnel,
    refuge programs, funding, and safety is given.  Habitat management is also covered.
     Subjects include wetlands, croplands, grasslands, and grazing.  The wildlife section
    of the report discusses waterfowl, migratory birds, game animals, and animal control.
     The public uses of the refuge described in this report include interpretive programs,
    hunting, and law enforcement.  The equipment and facilities section of the report
    provides information about new construction, maintenance, and energy conservation.
     Items of interest are provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
